// src/components/FreelancerFilters.js
import React, { useState } from 'react';

const FreelancerFilters = ({ onFilterChange }) => {
  const [jobProfileFilter, setJobProfileFilter] = useState('');
  const [paygradeFilter, setPaygradeFilter] = useState('');
  const [estimatedTimeFilter, setEstimatedTimeFilter] = useState('');

  const handleFilter = () => {
    // Notify the parent component about the filter changes
    if (onFilterChange) {
      onFilterChange(jobProfileFilter, paygradeFilter, estimatedTimeFilter);
    }
  };

  return (
    <div>
      <h2>Freelancer Filters</h2>
      <label>
        Job Profile:
        <input
          type="text"
          value={jobProfileFilter}
          onChange={(e) => setJobProfileFilter(e.target.value)}
        />
      </label>
      <label>
        Paygrade:
        <input
          type="text"
          value={paygradeFilter}
          onChange={(e) => setPaygradeFilter(e.target.value)}
        />
      </label>
      <label>
        Estimated Time:
        <input
          type="text"
          value={estimatedTimeFilter}
          onChange={(e) => setEstimatedTimeFilter(e.target.value)}
        />
      </label>
      <button onClick={handleFilter}>Apply Filters</button>
    </div>
  );
};

export default FreelancerFilters;
